import React, { useState } from 'react';
import jsPDF from 'jspdf';
const Reciept = () => {
  const [pdfContent, setPdfContent] = useState('');
  const [downloadUrl, setDownloadUrl] = useState('');

  const handleGeneratePdf = async () => {

    const data = {
      'INPUT_NAME': 'Salik',
        'INPUT_PHONENUMBER': '123456',
        'INPUT_COUNTRY': 'India',
        'INPUT_ADDRESS': '123 Main St',
        'INPUT_RNAME': 'Avdhan',
        'INPUT_RPHONENUMBER': '76542676',
        'INPUT_RCOUNTRY': 'Rajasthan',
        'INPUT_RADDRESS': '4332 Main St',
        'INP_PT': 'Internation Parcel',
        'INP_AN': 'efwfaew',
        'INP_INS': '234234',
        'INP_VALUE': '2342342',
        'INP_WT': '23Kg',
        'INP_QUANTITY': '50000'
    };
  

    const doc = new jsPDF();
  
    // Set the title
    doc.setFontSize(24);
    doc.text('ARTICLE BOOKED', 15, 20);
  
    // Add the barcode image
    const imgData = "src";
    doc.addImage(imgData, 'PNG', 15, 40, 100, 100);
  
    // Sender's Details
    doc.setFontSize(14);
    doc.text('SENDER\'S DETAILS -', 15, 150);
    doc.autoTable({
      startY: 160,
      head: [['NAME', 'PHONE NUMBER', 'COUNTRY', 'ADDRESS']],
      body: [
        [
          data.INPUT_NAME,
          data.INPUT_PHONENUMBER,
          data.INPUT_COUNTRY,
          data.INPUT_ADDRESS
        ]
      ],
    });
  
    // Receiver's Details
    doc.setFontSize(14);
    doc.text('RECEIVER\'S DETAILS -', 15, doc.autoTable.previous.finalY + 10);
    doc.autoTable({
      startY: doc.autoTable.previous.finalY + 20,
      head: [['NAME', 'PHONE NUMBER', 'COUNTRY', 'ADDRESS']],
      body: [
        [
          data.INPUT_RNAME,
          data.INPUT_RPHONENUMBER,
          data.INPUT_RCOUNTRY,
          data.INPUT_RADDRESS
        ]
      ],
    });
  
    // Article Details
    doc.setFontSize(14);
    doc.text('ARTICLE DETAILS -', 15, doc.autoTable.previous.finalY + 10);
    doc.autoTable({
      startY: doc.autoTable.previous.finalY + 20,
      head: [
        ['ARTICLE ID', 'PRODUCT TYPE', 'ARTICLE NAME', 'INSURED', 'VALUE(INR)', 'GROSS WT', 'QUANTITY'],
      ],
      body: [
        [
          '1',
          data.INP_PT,
          data.INP_AN,
          data.INP_INS,
          data.INP_VALUE,
          data.INP_WT,
          data.INP_QUANTITY
        ],
        ['', '', '', '', '', '', ''],
        ['', '', '', '', '', '', ''],
      ],
    });
  
    // Payment Details
    doc.setFontSize(14);
    doc.text('PAYMENT DETAILS -', 15, doc.autoTable.previous.finalY + 10);
    doc.autoTable({
      startY: doc.autoTable.previous.finalY + 20,
      head: ['PAYMENT SESSION', 'PAYMENT GATEWAY', 'PAYMENT AMOUNT'],
      body: [['1', 'PAYPAL', '3000']],
    });
  
    // Add the India Post image
    const indiaPostImgData = 'https://logosdownload.com/logo/india-post-logo-big.png';
    doc.addImage(indiaPostImgData, 'PNG', 15, doc.autoTable.previous.finalY + 40, 200, 100);
  
    // Save the PDF to a blob and create a download link
    const pdfBlob = doc.output('blob');
    const pdfUrl = URL.createObjectURL(pdfBlob);
    setDownloadUrl(pdfUrl);
  };
  
  return (
    <div>
      <button onClick={handleGeneratePdf}>Generate PDF</button>
      {downloadUrl && (
        <div>
          <iframe title="Generated PDF" src={downloadUrl} width="100%" height="500px" />
          <a href={downloadUrl} download="generated.pdf">Download PDF</a>
        </div>
      )}
    </div>
  );
};

export default Reciept;
